let callAPI = async () => {
    let _data3 ={
        "requests": [
            {
            "image": {
                "content": hinh.src.slice(23)
            },
            "features": [
                {
                "type": "TEXT_DETECTION"
                }
            ]
            }
        ]
        }
    
    let a = await fetch('https://vision.googleapis.com/v1/images:annotate?key=AIzaSyAIxX-cjeUvn2UFjxcX5EdKTob7YmOfeZY', {
        method: 'POST',
        
        body: JSON.stringify(_data3)
    })
    // console.log(hinh.src,hinh.src.slice(23))
    return await a.json();
}



